import MainHeader from "../MainHeader/MainHeader";
import Card from "../UI/Card/Card";

function Home(props) {
  return (
    <div>
        <MainHeader email={props.email}/>
      <h2>Welcome Home</h2>
    </div>
  );
}
export default Home;
